import React from 'react';
import './Folder.css';

function Folder({ name, image }) {
    return (
        <a href={`/index?lang=${name}`} className="folder" style={{ backgroundImage: `url(${image})` }}>
            <span>{name}</span>
        </a>
    );
}

export default Folder;
